import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [params, setParams] = useState({ price: 0, godhet: "god", volym: "2" });

  const handleChange = (evt) => {
    const value = evt.target.value;
    setParams({
      ...params, [evt.target.name]: value
    });
  }


  return (
    <div className="App">
      <div>
        <div>
          pris <input type="text" name="price" value={params.price} onChange={handleChange} />
        </div>
        <div>
          god <input type="text" name="godhet" value={params.price} onChange={handleChange} />
        </div>
        <div>
          volym <input type="text" name="volym" value={params.price} onChange={handleChange} />
        </div>
      </div>
    </div>
  );
}

export default App;
